import React from 'react';
import './index.css';
import { Button, Navbar, Nav, NavDropdown, Form, FormControl, Brand, Toggle, NavItem } from 'react-bootstrap';
import { Switch, Route, BrowserRouter as Router } from "react-router-dom";
import LeftSidebar from './LeftSidebar'
import Video from './Video'



function UnViewed(props) {

    function isViewed(boolVal, video) {
        if(boolVal) {
            return ( <Video videoDetails={video}/> )
        } else {
            return <h1>Hi</h1>
        }
    }

  return (
    <div id="videos-container">
        <LeftSidebar />
        <div id="right-side">
            <div id="videosContainer">

            {
              props.videos.map( video => {
                isViewed(video.isViewed, video);
              })
            }

            </div>
        </div>
    </div>
  );
}

export default UnViewed;
